window.bookSummaryJSON = "<p>After years of living abroad, Maizy returns home to the only family she's ever known - a pack of wolves. When she confronts her childhood watchdog to see where they stand, his resentment leaves her uncertain about where she really belongs. </p> <p>Behind Denver's charming smile is a tragic past - one that's made his wolf savage and unpredictable. Only Maizy has been able to tame that darkness. And when they're reunited after many years apart, he no longer sees a child he once protected. She's captivating and intelligent - a woman with the world at her fingertips and two suitors offering more than he ever could. </p> <p>Torn between two worlds, Maizy must choose how her fairy tale ends. Tragedy, murder, passion, and imprisonment all collide with a heart-stopping twist. </p>"; 
